import React from 'react';
import ResultsItem from '../ResultsItem';

function ResultsList(props) {
  return (
    <ul className="list-group">
      <ResultsItem 
        handler={props.handler}
      />
      <ResultsItem />
      <ResultsItem />
      <ResultsItem />
    </ul>
  )
}

export default ResultsList;
